import { useEffect } from "react";
import "./index.css";
import Cookies from "js-cookie";
import { useNavigate } from "react-router-dom";


const Home = ()=>
{
    const navigate = useNavigate()
    useEffect(()=>
    {
        const token = Cookies.get("jwt-token");
        if(token === undefined)
        {
            navigate("/login");
        }

    },[])

    return(
        <div>
            <h1>
                Home
            </h1>
        </div>
    )

}

export default Home
